ns Presents","promoterName":"Kickstand Productions Presents","sponsorName":"","sponsorImage":null,"additionalInfo":"","additionalTicketText":"","ageLimitCode":"OVER_17","ageLimit":"17 and Over","showTypeCode":null,"showType":"","eventStatusCode":"TIX_AT_DOOR","eventStatus":"Tickets at the Door","eventStatusMessage":"","ticketPurchaseUrl":"https://www.ticketfly.com/purchase/event/1326841?utm_medium=api","ticketPrice":"$13.00","externalTicketingUrls":[],"multiEventCartable":true,"facebookEventId":1287357834631338,"facebookEventIdString":"1287357834631338","headliners":[{"id":771149,"name":"Tony Molina","startTime":null,"eventDescription":"Constantly juggling hardcore and pop projects, Bay Area veteran musician, Tony Molina has won over fans in both camps. Since 2002, Molina has played in several bands including Dystrophy, Ovens, Lifetime Problems, Caged Animal and currently, his solo work. In both hardcore and pop, Molina values lyrical simplicity, structural concision, and the emotional impact of guitar riffs.

Two recent releases — the wistful riff rock of his first solo album, Dissed and Dismissed, and his new hardcore band Caged Animal’s barbaric debut EP — illustrate the striking dichotomy that runs throughout Molina’s discography over the last eleven years. On Dissed and Dismissed, Molina intensifies the slacker clichés and self-deprecation of Nineties indie rock into absurdist hyperbole. He expresses vulnerability and melodrama through bizarre truisms while referencing his forebears: Thin Lizzy leads, Radiohead lyrics, Replacements sneer. Molina appropriates unapologetically, but distills the past into bursts of reverence less than a minute long.

Andee Connors, of vaunted San Francisco music institution Aquarius Records, attempted to catch up with Molina’s bountiful recordings, releasing a 44-track, self-titled Ovens CD on his own tUMULt imprint. The massive compilation contains recordings from 2006 to 2008. In his writing for the Aquarius catalog, Connors has repeatedly christened Molina a “pop genius.”","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atjmbo.jpg","width":500,"height":331},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atjmbo1.jpg","width":500,"height":331},"large":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atlg.jpg","width":300,"height":199},"large1":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atlg1.jpg","width":300,"height":199},"medium":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atmd.jpg","width":200,"height":132},"medium1":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atmd1.jpg","width":200,"height":132},"original":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-og.jpg","width":500,"height":331},"small":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atsm.jpg","width":100,"height":66},"small1":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atsm1.jpg","width":100,"height":66},"square":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-sqsm.jpg","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atxl.jpg","width":500,"height":331},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atxl1.jpg","width":500,"height":331},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atxxl.jpg","width":500,"height":331},"xxlarge1":{"path":"http://cdn.ticketfly.com/i/00/00/99/81/03-atxxl1.jpg","width":500,"height":331}},"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://tonymolinahyv.tumblr.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/tonymolina650","urlTwitter":"http://twitter.com/tonymolina_650","twitterScreenName":"tonymolina_650"}],"supports":[{"id":1723667,"name":"Wildhoney","startTime":null,"eventDescription":"Wildhoney formed in late 2011, aiming to write pop songs with the energy and malcontent of hardcore punk, but without its entrenched masculinity. The five-piece has since become one of the loudest—and sweetest—bands in its hometown of Baltimore.'Sleep Through It' expands on two excellent 7-inches and one cassette EP, drawing influences from '60s girl groups, '80s post punk, indie pop, and shoegaze. Throughout the album, the group's blasts of distortion and use of dense textures are balanced with beautiful pop tunes and chiming guitar work. Sleep Through It was recorded at Beat Babies Studio in Woodstock, Md., with Chris Freeland (Lower Dens, Wye Oak).","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"http://wildhoneysound.tumblr.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/wildhoneysound","urlTwitter":"http://twitter.com/wildhoneybmore","twitterScreenName":"wildhoneybmore"},{"id":1763383,"name":"Delmar & the Dedications","startTime":null,"eventDescription":"","isMobileFriendly":"false","image":null,"youtubeVideos":[],"embedAudio":"","embedVideo":"","urlAudio":"","urlPurchaseMusic":"","urlOfficialWebsite":"https://letsplayspinthebottle.bandcamp.com/","urlMySpace":"","urlFacebook":"https://www.facebook.com/Delmar-The-Dedications-305134748561","urlTwitter":"","twitterScreenName":""}],"urlEventDetailsUrl":"http://www.ticketfly.com/event/1326841?utm_medium=api"}]}
